商品名：クレハ　キチントさん　ごはん冷凍保存容器　大盛　４個<br>内容量：4個<br>ブランド：キチントさん<br>原産国：日本<br><br>蒸気弁つき！冷凍ごはんをムラなく加熱<br>キチントさん「ごはん冷凍保存容器」は、ごはんをおいしく冷凍⇔加熱できる容器です。<br>使用方法：１．炊きたてごはんを入れ、すぐにフタを閉めます。２．あら熱がとれたら冷凍します。３．食べる時は、蒸気弁を開けて、フタをしたまま電子レンジで加熱します。<br>問合せ先：株式会社クレハお客様相談室　〒１０３－８５５２　東京都中央区日本橋浜町３－３－２　ＴＥＬ０１２０－０３－９０８０　９：００－１２：００、１２：４５－１７：３０（土曜、日曜、祝日除く）<br><br>JANコード:4901422338886<br><br><br>商品番号：101-62947<br><br><br><br>区分: 容器・ストッカー・調味料容器 <br><br><br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
